INSERT INTO `exercises` (`id`, `data`, `createdAt`, `updatedAt`, `subtopicId`) VALUES (1,'/*\r\n  Generate the question of format:\r\n    X + 5 = 10 or 7 + X = 12\r\n\r\n  General form:\r\n    X + a = b or a + X = b\r\n\r\n  Constraints:\r\n    0 < A < 10\r\n    0 < B < 10\r\n    0 <= x < 15\r\n*/\r\n\r\nvar _ = require(\'lodash\')\r\n// var MathHelper = require(\'./math-helper\')\r\n\r\nconst knowns = [\'a\', \'b\']\r\nconst unknowns = [\'x\']\r\n\r\nconst randomGeneratorFn = () => {\r\n  const result = {knowns: {}, unknowns: {}}\r\n  result.knowns.b = _.random(10, 30)\r\n  result.knowns.a = _.random(1, result.knowns.b)\r\n  result.unknowns.x = result.knowns.b - result.knowns.a\r\n  return result\r\n}\r\n\r\n// param1: knowns\r\n// param2: unknowns\r\nconst isAnswerFn = ({a, b}, {x}) => {\r\n  a = parseInt(a)\r\n  b = parseInt(b)\r\n  x = parseInt(x)\r\n  return x + a === b\r\n}\r\n\r\n// Describe how the question will be printed\r\nconst printFn = ({a, b}) => {\r\n  const formatted = [`x + ${a} = ${b}`, `${a} + x = ${b}`]\r\n  return _.sample(formatted)\r\n}\r\n\r\n// In addition to exact matches, this describe the other matches\r\n// unknowns1 = {a, b}\r\n// unknowns2 = {a, b}\r\nconst isEqualFn = (unknowns1, unknowns2) => {\r\n  // For this example, exact match is the only match\r\n  return _.isEqual(unknowns1, unknowns2)\r\n}\r\n\r\nmodule.exports = {\r\n  quantity: 5, // The number of questions to be generated\r\n  solver: {\r\n    type: \'bruteforce_solver\', // The questions are generated using bruteforce\r\n    randomGeneratorFn, // \'bruteforce_solver\' uses random generator to generate each of the variables\r\n    isEqualFn, // Return true if 2 equations are the same\r\n    timeout: 1000 // Maximum time to generate all of the questions\r\n  },\r\n  knowns, // \'Given\' variables\r\n  unknowns, // \'Question\' variables\r\n  isAnswerFn, // Return true if the combination of \'knowns\' and \'unknowns\' solve the problem\r\n  printFn // Print the question\r\n}\r\n','2017-11-01 07:50:22','2017-12-05 05:59:04',1),(2,'/*\r\n  Generate the question of format:\r\n    X - 5 = 3\r\n\r\n  General form:\r\n    X - a = b\r\n\r\n  Constraints:\r\n    7 < b < 20\r\n    b < a < 25\r\n*/\r\n\r\nvar _ = require(\'lodash\')\r\n\r\nconst knowns = [\'a\', \'b\']\r\nconst unknowns = [\'x\']\r\n\r\nconst randomGeneratorFn = () => {\r\n  const result = {knowns: {}, unknowns: {}}\r\n  result.knowns.b = _.random(1, 30)\r\n  result.knowns.a = _.random(result.knowns.b, 25)\r\n  result.unknowns.x = result.knowns.a + result.knowns.b\r\n  return result\r\n}\r\n\r\n// param1: knowns\r\n// param2: unknowns\r\nconst isAnswerFn = ({a, b}, {x}) => {\r\n  a = parseInt(a)\r\n  b = parseInt(b)\r\n  x = parseInt(x)\r\n  return x - a === b\r\n}\r\n\r\n// Describe how the question will be printed\r\nconst printFn = ({a, b}) => {\r\n  return `\r\nx - ${a} = ${b}\r\n`\r\n}\r\n\r\n// In addition to exact matches, this describe the other matches\r\n// unknowns1 = {a, b}\r\n// unknowns2 = {a, b}\r\nconst isEqualFn = (unknowns1, unknowns2) => {\r\n  // For this example, exact match is the only match\r\n  return _.isEqual(unknowns1, unknowns2)\r\n}\r\n\r\nmodule.exports = {\r\n  quantity: 5, // The number of questions to be generated\r\n  solver: {\r\n    type: \'bruteforce_solver\', // The questions are generated using bruteforce\r\n    randomGeneratorFn, // \'bruteforce_solver\' uses random generator to generate each of the variables\r\n    isEqualFn, // Return true if 2 equations are the same\r\n    timeout: 1000 // Maximum time to generate all of the questions\r\n  },\r\n  knowns, // \'Given\' variables\r\n  unknowns, // \'Question\' variables\r\n  isAnswerFn, // Return true if the combination of \'knowns\' and \'unknowns\' solve the problem\r\n  printFn // Print the question\r\n}','2017-11-01 07:50:35','2017-12-05 05:59:04',1),(3,'/*\r\n  Generate the question of format:\r\n    5x = 10\r\n\r\n  General form:\r\n    ax = b\r\n*/\r\n\r\nvar _ = require(\'lodash\')\r\n\r\nvar mathjax = require(path.join(__dirname, \'./lib/mathjax-helper\'))\r\n\r\nconst knowns = [\'a\', \'b\']\r\nconst unknowns = [\'x\']\r\n\r\nconst randomGeneratorFn = () => {\r\n  const result = {knowns: {}, unknowns: {}}\r\n  result.knowns.a = _.random(1, 15)\r\n  const multiplier = _.random(1, 15)\r\n  result.knowns.b = result.knowns.a * multiplier\r\n  result.unknowns.x = result.knowns.b / result.knowns.a\r\n  return result\r\n}\r\n\r\n// param1: knowns\r\n// param2: unknowns\r\nconst isAnswerFn = ({a, b}, {x}) => {\r\n  a = parseInt(a)\r\n  b = parseInt(b)\r\n  x = parseInt(x)\r\n\r\n  return x === b / a\r\n}\r\n\r\n// Describe how the question will be printed\r\nconst printFn = ({a, b}) => {\r\n  return mathjax(`${a}x = ${b}`).then(resp => {\r\n    return resp.data.svg\r\n  })\r\n}\r\n\r\n// In addition to exact matches, this describe the other matches\r\n// unknowns1 = {a, b}\r\n// unknowns2 = {a, b}\r\nconst isEqualFn = (question1, question2) => {\r\n  // For this example, exact match is the only match\r\n  return _.isEqual(question1, question2)\r\n}\r\n\r\nmodule.exports = {\r\n  quantity: 5, // The number of questions to be generated\r\n  solver: {\r\n    type: \'bruteforce_solver\', // The questions are generated using bruteforce\r\n    randomGeneratorFn, // \'bruteforce_solver\' uses random generator to generate each of the variables\r\n    isEqualFn, // Return true if 2 equations are the same\r\n    timeout: 1000 // Maximum time to generate all of the questions\r\n  },\r\n  knowns, // \'Given\' variables\r\n  unknowns, // \'Question\' variables\r\n  isAnswerFn, // Return true if the combination of \'knowns\' and \'unknowns\' solve the problem\r\n  printFn // Print the question\r\n}\r\n','2017-11-04 04:46:38','2018-02-22 04:57:56',2),(4,'/*\r\n  Generate the question of format:\r\n    5 * X = 10\r\n\r\n  General form:\r\n    X / a = b\r\n*/\r\n\r\nvar _ = require(\'lodash\')\r\nvar path = require(\'path\')\r\nvar mathjax = require(path.join(__dirname, \'./lib/mathjax-helper\'))\r\n// var MathHelper = require(\'./math-helper\')\r\n\r\nconst knowns = [\'a\', \'b\']\r\nconst unknowns = [\'x\']\r\n\r\nconst randomGeneratorFn = () => {\r\n  const result = {knowns: {}, unknowns: {}}\r\n\r\n  result.knowns.b = _.random(1, 15)\r\n  result.knowns.a = _.random(1, 15)\r\n  result.unknowns.x = result.knowns.b * result.knowns.a\r\n  return result\r\n}\r\n\r\n// param1: knowns\r\n// param2: unknowns\r\nconst isAnswerFn = ({a, b}, {x}) => {\r\n  a = parseInt(a)\r\n  b = parseInt(b)\r\n  x = parseInt(x)\r\n  return x === b * a\r\n}\r\n\r\n// Describe how the question will be printed\r\nconst printFn = ({a, b}) => {\r\n  return new Promise((resolve, reject) => {\r\n    mathjax(`\\\\frac{x}{${a}} = ${b}`).then(resp => {\r\n      resolve(`${resp.data.svg}`)\r\n   	}).catch(reject)\r\n  })\r\n}\r\n\r\n// In addition to exact matches, this describe the other matches\r\n// unknowns1 = {a, b}\r\n// unknowns2 = {a, b}\r\nconst isEqualFn = (unknowns1, unknowns2) => {\r\n  // For this example, exact match is the only match\r\n  return _.isEqual(unknowns1, unknowns2)\r\n}\r\n\r\nmodule.exports = {\r\n  quantity: 5, // The number of questions to be generated\r\n  solver: {\r\n    type: \'bruteforce_solver\', // The questions are generated using bruteforce\r\n    randomGeneratorFn, // \'bruteforce_solver\' uses random generator to generate each of the variables\r\n    isEqualFn, // Return true if 2 equations are the same\r\n    timeout: 1000 // Maximum time to generate all of the questions\r\n  },\r\n  knowns, // \'Given\' variables\r\n  unknowns, // \'Question\' variables\r\n  isAnswerFn, // Return true if the combination of \'knowns\' and \'unknowns\' solve the problem\r\n  printFn // Print the question\r\n}\r\n','2017-11-04 04:46:38','2018-02-22 04:57:56',2),(5,'/*\r\n  Generate the question of format:\r\n    5x + 5 = 20\r\n\r\n  General form:\r\n    ax + b = c\r\n*/\r\nvar path = require(\'path\')\r\n  \r\nvar _ = require(\'lodash\')\r\n\r\nvar mathjax = require(path.join(__dirname, \'lib/mathjax-helper\'))\r\n// var MathHelper = require(\'./math-helper\')\r\n\r\nconst knowns = [\'a\', \'b\', \'c\']\r\nconst unknowns = [\'x\']\r\n\r\nconst randomGeneratorFn = () => {\r\n  const result = {knowns: {}, unknowns: {}}\r\n  \r\n  // x = (c - b) / a\r\n  result.unknowns.x = _.random(5, 15)\r\n  // a = random\r\n  result.knowns.a = _.random(-10, 10)\r\n  // (c - b) = x * a\r\n  const c_min_b = result.knowns.a * result.unknowns.x\r\n  // c = random < c_min_b\r\n  result.knowns.c = _.random(1, c_min_b)\r\n  // b = -1 * ( (c - b) - c)\r\n  result.knowns.b = -1 * (c_min_b - result.knowns.c)\r\n  \r\n  return result\r\n}\r\n\r\n// param1: knowns\r\n// param2: unknowns\r\nconst isAnswerFn = ({a, b, c}, {x}) => {\r\n  a = parseInt(a)\r\n  b = parseInt(b)\r\n  c = parseInt(c)\r\n  x = parseInt(x)\r\n  return x === (c - b) / a\r\n}\r\n\r\n// Describe how the question will be printed\r\nconst printFn = ({a, b, c}) => {\r\n  var plusOrMinus = val => val >= 0 ? \'+\' : \'-\'\r\n  return mathjax(`${a}x ${plusOrMinus(b)} ${Math.abs(b)} = ${c}`).then(resp => resp.data.svg)\r\n}\r\n\r\n// In addition to exact matches, this describe the other matches\r\n// unknowns1 = {a, b}\r\n// unknowns2 = {a, b}\r\nconst isEqualFn = (unknowns1, unknowns2) => {\r\n  // For this example, exact match is the only match\r\n  return _.isEqual(unknowns1, unknowns2)\r\n}\r\n\r\nmodule.exports = {\r\n  quantity: 5, // The number of questions to be generated\r\n  solver: {\r\n    type: \'bruteforce_solver\', // The questions are generated using bruteforce\r\n    randomGeneratorFn, // \'bruteforce_solver\' uses random generator to generate each of the variables\r\n    isEqualFn, // Return true if 2 equations are the same\r\n    timeout: 1000 // Maximum time to generate all of the questions\r\n  },\r\n  knowns, // \'Given\' variables\r\n  unknowns, // \'Question\' variables\r\n  isAnswerFn, // Return true if the combination of \'knowns\' a